%[text] # **Brownian Bridge Interpolation**
%[text:tableOfContents]{"heading":"Table of Contents"}
%%
%[text] ## Generate correlated random data for two series
rng default
rho = [1, 0.2; 0.2, 1];
N = 199;
U = copularnd( "Gaussian", rho, N );
rets = norminv( U );
%%
%[text] ## Convert returns to prices
prices = cumsum( [100, 100; rets] ); % Initial value 100, say

figure %[output:1e4fc50a]
plot( prices, "LineWidth", 2 ) %[output:1e4fc50a]
xlabel( "Sample" ) %[output:1e4fc50a]
ylabel( "Value" ) %[output:1e4fc50a]
title( "Simulated Prices" ) %[output:1e4fc50a]
grid on %[output:1e4fc50a]
%%
%[text] ## Insert some gaps in the first series containing NaNs
gapIdx = [5:10, 28:37, 55:56, 78:84, 145:149];
gappyPrices = prices;
gappyPrices(gapIdx, 1) = NaN;
gappySeries = gappyPrices(:, 1);
%%
%[text] ## Estimate GBM model parameters
retsMu = mean( rets ) / N;
retsSigma = std( rets ) / N;
drift = diag( retsMu );
diffusion = diag( retsSigma );
rho = corr( rets );
%%
%[text] ## Build the GBM
mdl = gbm( drift, diffusion, "Correlation", rho );
%%
%[text] ## Create an evenly-spaced time vector
T = (1 : N+1).';
%%
%[text] ## Find the start and end indices of each bridge
%[text] Note that Brownian bridge interpolation requires a valid value on either side of the bridge. If the series begins or ends with NaNs then a different method should be used.
changes = diff( [false; isnan( gappySeries )] );
bridgeStart = find( changes == 1 ) - 1;
bridgeEnd = find( changes == -1 );
%%
%[text] ## Use the model to interpolate over each gap
filledSeries = gappySeries;

for k = 1 : numel( bridgeStart )
    
    % Bridge time vector
    t = bridgeStart(k) : bridgeEnd(k);
    
    % Bridge end points (data)
    X = gappyPrices([bridgeStart(k), bridgeEnd(k)], :); 
    
    % Bridge end points (time)
    XT = T([bridgeStart(k), bridgeEnd(k)]);
    
    % Interpolate
    bridgeValues = interpolate( mdl, t, X, "Times", XT );
    filledSeries(t) = bridgeValues(:, 1);

end % for
%%
%[text] ## Inspect the bridges
c = colororder();
figure %[output:6602109e]
plot( T, gappySeries, ".-", "LineWidth", 2, "MarkerSize", 12 ) %[output:6602109e]
hold on %[output:6602109e]
for k = 1 : numel( bridgeStart )
    t = bridgeStart(k) : bridgeEnd(k);
    plot( t, filledSeries(t), ".-", ... %[output:6602109e]
        "LineWidth", 2, ... %[output:6602109e]
        "Color", c(2, :), ... %[output:6602109e]
        "MarkerSize", 12 ) %[output:6602109e]
end
xlabel( "Time (samples)" ) %[output:6602109e]
ylabel( "Price" ) %[output:6602109e]
title( "Brownian Bridge Interpolation" ) %[output:6602109e]
grid on %[output:6602109e]
legend( "Gappy Price Series", "Interpolated Price Series" ) %[output:6602109e]

